INSERT INTO `Category` VALUES (3,'Advanced Massage Therapies by Elemis','',1,1,1,'',''),(2,'Exotics by Elemis','',1,2,1,'',''),(1,'Massage & Body Therapy','',91,1,1,'',''),(4,'Skin Therapy','',91,2,1,'',''),(5,'Time for Men','',91,3,1,'',''),(6,'Footcare','',27,0,1,'',''),(7,'Handcare','',27,0,1,'',''),(8,'Self-Tanning','',91,5,1,'',''),(9,'Eyes','',91,6,1,'',''),(10,'Make-up','The most beautiful cosmetic you can wear is a healthy skin.  Thats why everything we develop is a true extension of skin care.  Our micronized mineral makeup is not just a refinement of normal makeup, its a new technology.  So effective it is recommended by plastic surgeons, dermatologists and skincare professionals.',91,8,1,'',''),(11,'Hair Removal','',91,9,1,'',''),(12,'Long-Time Liner','For those of us who have always wished for Perfect Eyebrows, Beautiful Lips and Smudge Free Eyeliner.<br><br>Let\'s be honest - which woman would not like to jump out of bed with perfect eyebrows, eye lines and beautiful lips?  The Long-Time-Liner&reg; Conture&reg; Make-Up method has 15 years experience!  During this time thousands of enthusiastic customers have stated that tiresome daily make-up belongs in the past. ',10,0,1,'',''),(27,'Hands and Feet','',91,4,1,'',''),(15,'Aroma Spa Ocean Wrap by Elemis','',1,3,1,'',''),(16,'Ritual Packages by Elemis','',1,4,1,'',''),(17,'Advanced Anti-Ageing Facials by Elemis','',4,1,1,'',''),(18,'Advanced Performance Facials by Elemis','',4,2,1,'',''),(19,'Skin Specific Facials by Elemis','',4,3,1,'',''),(20,'Body Ultimate Facial Toning','Using a relaxing micro-current to lift and tone facial muscles improving the contour of the face.  Additionally, the treatment improves and refines skin texture, reducing fine lines and wrinkles, leaving the skin fresh and rejuvenated.  <b>The ideal anti-ageing treatment.</b>',4,4,1,'',''),(22,'Nail Enhancements by CalGel','',27,0,1,'',''),(23,'Womens Hair Removal','',11,0,1,'',''),(24,'Mens Hair Removal','',11,0,1,'',''),(25,'Eyelash Extensions','',9,2,1,'',''),(26,'3-D Lashes','3 D-Lash Extensions are an exciting and innovative product for thicker, longer natural looking eyelashes.  They have incredible bonding power lasting 6-8 weeks or longer.  They are resistant to water, shower, sweat, exercise, tears, swimming and even sleeping.  They give longer fuller totally natural looking lashes that are weightless and very comfortable.  \r\rMost people who wear 3 D-lashes find that they already look darker and thicker, but water based mascara can be used on the tips for further enhancement.\r\rThe procedure is very comfortable and relaxing, takes approx 1.5 hrs.  Safely and professionally applied by your eyelash technician causing no damage via state-of-the-art technique.  Due to the natural life cycle of the lashes top ups should be done approx every 2-3 weeks if required taking only 30 min.',9,3,1,'',''),(28,'Skin Intelligence for Men','These facials are tailored to meet the demands of a hectic lifestyle and to combat the harsh, ageing effects of the modern environment, giving men the ultimate skin overhaul with maximum results.',5,2,1,'',''),(35,'Shaping and Tinting','',9,1,1,'',''),(91,'','',NULL,0,0,'','');
