INSERT INTO `Menu` VALUES (1,'HOME','',0,0,0,NULL,NULL,'home.do',NULL,0),(2,'TREATMENTS','',0,0,0,NULL,NULL,'treatments.do?nav.cat=7&loc=Swansea&kw=Elemis',2,0),(3,'PRODUCTS','',0,0,0,NULL,NULL,'productsIndex.do?loc=Swansea&kw=Elemis',NULL,0),(4,'SUNBEDS','',-1,0,0,NULL,NULL,'sunbedsIndex.do?loc=Swansea',NULL,0),(5,'POWER PLATE<sup>&reg;</sup>','',-1,0,0,NULL,NULL,'powerPlateIndex.do?loc=Swansea&kw=Power%20Plates',NULL,0),(6,'Contact Us','',1,1,0,NULL,NULL,'contact.do',NULL,0),(7,'Massage & Body Therapy','',2,1,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(8,'Skin Therapy','',2,2,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(9,'Time for Men','',2,3,0,'elemis-lotus-small.gif',NULL,'treatments.do',3,0),(10,'Hands and Feet','',2,4,0,NULL,NULL,'treatments.do',NULL,0),(11,'Self-Tanning','',-1,5,0,NULL,NULL,'treatments.do',NULL,0),(12,'Eyes','',2,6,0,NULL,NULL,'treatments.do',NULL,0),(13,'Make-Up','The most beautiful cosmetic you can wear is a healthy skin.  Thats why everything we develop is a true extension of skin care.  Our micronized mineral makeup is not just a refinement of normal makeup, its a new technology.  So effective it is recommended by plastic surgeons, dermatologists and skincare professionals.',2,7,0,NULL,NULL,'treatments.do',1,0),(14,'Hair Removal','',2,8,0,NULL,NULL,'treatments.do',NULL,0),(15,'Advanced Massage Therapies','',7,1,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(16,'Exotics by Elemis','',7,2,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(17,'Aroma Spa Ocean Wrap by Elemis','',7,3,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(18,'Ritual Packages by Elemis','',7,4,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(19,'Advanced Anti-Ageing Facials','',8,1,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(20,'Advanced Performance Facials','',8,2,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(21,'Skin Specific Facials','',8,3,0,'elemis-lotus-small.gif',NULL,'treatments.do',NULL,0),(22,'Body Ultimate Facial Toning','Using a relaxing micro-current to lift and tone facial muscles improving the contour of the face.  Additionally, the treatment improves and refines skin texture, reducing fine lines and wrinkles, leaving the skin fresh and rejuvenated.  <b>The ideal anti-ageing treatment.</b>',8,4,0,NULL,NULL,'treatments.do',NULL,0),(23,'Skin Intelligence for Men','These facials are tailored to meet the demands of a hectic lifestyle and to combat the harsh, ageing effects of the modern environment, giving men the ultimate skin overhaul with maximum results.',9,1,0,'elemis-lotus-small.gif',NULL,'treatments.do',3,0),(24,'Footcare','',10,1,0,NULL,NULL,'treatments.do',NULL,0),(25,'Handcare','',10,2,0,NULL,NULL,'treatments.do',NULL,0),(26,'Nail Enhancements by CalGel','',10,3,0,NULL,NULL,'treatments.do',NULL,0),(28,'Eyelash Extensions','',12,2,0,NULL,NULL,'treatments.do',NULL,0),(29,'3-D Lashes','3 D-Lash Extensions are an exciting and innovative product for thicker, longer natural looking eyelashes.  They have incredible bonding power lasting 6-8 weeks or longer.  They are resistant to water, shower, sweat, exercise, tears, swimming and even sleeping.  They give longer fuller totally natural looking lashes that are weightless and very comfortable.  ',12,3,0,NULL,NULL,'treatments.do',NULL,0),(30,'Long-Time Liner','For those of us who have always wished for Perfect Eyebrows, Beautiful Lips and Smudge Free Eyeliner.<br><br>Let\'s be honest - which woman would not like to jump out of bed with perfect eyebrows, eye lines and beautiful lips?  The Long-Time-Liner&reg; Conture&reg; Make-Up method has 15 years experience!  During this time thousands of enthusiastic customers have stated that tiresome daily make-up belongs in the past. ',13,1,0,NULL,NULL,'treatments.do',1,0),(31,'Womens Hair Removal','',14,1,0,NULL,NULL,'treatments.do',NULL,0),(32,'Mens Hair Removal','',14,2,0,NULL,NULL,'treatments.do',NULL,0),(33,'Elemis','Elemis is the leading professional range of skin care and aromatherapy products made in England and is available in only the most exclusive salons and spa\'s world-wide.<br><br>Elemis is a name synonymous all over the world with the finest quality medicinal plants, organic herbs and revitalising seaweed extracts, blended with the most active natural bases possible.  Dedicated to research, always striving for new discoveries in the field of Aromatherapy and natural plant extracts, Elemis is a range that you can trust for efficacy, purity, and safety, with no animal testing.<br><br>A wide range of products are provided in the following areas:<ul><li>Daily skin health<li>Skin boosters<li>Time For men<li>Inner health, fitness and diet<li>The senses of aromatherapy<li>Body essentials<li>Aroma spa body boosters<li>Home spa bathing</ul><br>Visit <a class=\"more\" href=\"http://www.elemis.com\">Elemis</a> for further information.',3,1,0,NULL,'elemis-spa-therapy.jpg','productsIndex.do',NULL,0),(34,'Australian Body Care','Australian Bodycare\'s skincare range is based on the totally natural and unique skin-friendly essential oil, Tea Tree (Melaleuca alternifolia). Tea Tree Oil is a natural antiseptic, bactericide, fungicide with anaesthetic qualities.<br><br>Contrary to most other antiseptic preparations, Tea Tree Oil is effective on many acute and prolonged problem skins and can be used daily, without causing an imbalance in the natural bacterial flora on the skin. Australian Bodycare products provide optimum hygiene in your daily skin care, strengthening the natural defence of the skin against problems.<br><br>Australian Bodycare products are hypoallergenic.<br><br>A wide range of products are available from Facial masks, Pore strips, and Moisturisers, to Baby shampoo and Bubblebath.',3,2,0,NULL,'TTlogo.jpg','productsIndex.do',NULL,0),(35,'St Tropez','Indulge yourself with the richest looking tan in the most luxurious way. Until now a tan this rich was only possible on the Riviera. Now the Riviera comes to you in St. Tropez products. A complete line of tanning essentials, with quality and excellence in every bottle, including:<br><br><table cellpadding=\"5\" cellspacing=\"0\" border=\"0\"><tr valign=\"top\"><td><nobr>Tinted Self-Tanning</nobr>	</td><td><font color=\"#993300\">A streakless, non-greasy application that will last for days.</font></td></tr><tr valign=\"top\"><td>Body Moisturiser with L -Tyrosine	</td><td><font color=\"#993300\">A blend of botanicals, essential oils and herbs, used to replenish moisture lost through tanning.<tr valign=\"top\"><td>Body Polisher	</td><td><font color=\"#993300\">Refines and renews skin to create an even, longer-lasting tan</font></td></tr></font></td></tr><tr valign=\"top\"><td>SPF 15 Waterproof Sport Lotion</td><td><font color=\"#993300\">Designed to provide water and sweat resistance for the active person, whilst giving UVA / UVB protection and replenishing lost moisture</font></td></tr></table>',3,3,0,NULL,NULL,'productsIndex.do',NULL,1),(36,'Jane Iredale','Known as The Skin Care Makeup, the jane iredale line is so safe and beneficial to use that it is recommended by Plastic Surgeons and Dermatologists throughout the world.<br><br>Jane\'s line is a highly-sophisticated blend of minerals and pigments that are micro-pulverized, using proprietary technology and processes to form microscopic flat crystals. These crystals overlap each other on the skin to form a filter that allows the skin to breathe and function normally while still protecting it from air-borne pollutants. The staying power of the minerals is so great that they rarely need a touch-up during the day. And because these silky-feeling powders are water resistant, they won\'t crease or smear even during the most strenuous exercise.<br><br>These state-of-the-art minerals are available in so many shades that there\'s one for every complexion no matter what the ethnicity.',3,5,0,NULL,'ji-logo.jpg','productsIndex.do',NULL,0),(37,'Jessica','',3,4,0,NULL,'jessica-logo.jpg','productsIndex.do',NULL,0),(38,'Skin Care','',99,1,0,NULL,NULL,'products.do',NULL,0),(39,'Body Care','',99,2,0,NULL,NULL,'products.do',NULL,0),(40,'Facial Products','',99,3,0,NULL,NULL,'products.do',NULL,0),(41,'Hair Products','',99,4,0,NULL,NULL,'products.do',NULL,0),(42,'Benefits','',5,2,0,NULL,NULL,'powerPlateBenefits.do',NULL,0),(43,'Session and Course Prices','',5,1,0,NULL,NULL,'powerPlateSessions.do',NULL,0),(44,'Spa, Beauty and Anti-Ageing','More than just an exercise and rehabilitation machine, Power Plate® machines offer the capacity for whole body massage and relaxation.<br><br>Not only can Power Plate® machines passively work all the muscle groups in the body, but they can reduce stress by decreasing cortisol levels while raising levels of serotonin.<br><br>Using Power Plate® machines helps increase circulation and oxygenate blood flow, leading to a decrease in toxins in the body, which causes a reduction in the appearance of cellulite. It also helps the body by increasing bone mineral density to fight osteoporosis, and increasing the production of collagen to encourage firmer, smoother skin.<br><br>These benefits contribute significantly to the complete spa experience.',42,1,0,NULL,'benefits_fitness_v.jpg','',NULL,0),(45,'Fitness','Power Plate® machines are a great alternative for people who enjoy an active lifestyle, but do not have the time for a lengthy work-out three or more times a week.<br><br>Acceleration Training<sup>TM</sup> exercise using Power Plate® machines offers a number of important benefits that will help fitness goals easily be achieved or exceeded.<br><br>These benefits range from an immediate improvement in blood circulation, to a variety of other measurable outcomes, such as increased muscle strength and flexibility, better range of motion, better core conditioning and stability, and faster recovery and regeneration.',42,2,0,NULL,'benefits_golf_vertical.jpg','',NULL,0),(46,'Rehabilitation','Not only can Acceleration Training<sup>TM</sup> exercise using Power Plate® machines prevent injuries, it can help rehabilitate them as well. Many professional sports teams have found Power Plate® machines to be indispensable for rehabilitation.<br><br>The ability to strengthen muscles without strain on joints and ligaments can be extremely valuable for patients with rehabilitation needs. Increased blood circulation helps bring oxygen to inflamed areas to promote healing, while improved lymphatic flow helps drain fluid build-up from injured tissue.<br><br>Physical therapists around the world have found the benefits of Power Plate® machines invaluable in their practices.',42,3,0,NULL,'benefits_rehab_v.jpg','',NULL,0),(48,'Session and Course Prices','',4,1,0,NULL,NULL,'sunbedSessions.do',NULL,0),(47,'Membership','',1,1,0,'','','',NULL,0),(49,'Benefits','',4,2,0,NULL,NULL,'sunbedsIndex.do',NULL,0),(50,'Gift Vouchers','',1,2,0,'','','',NULL,0);
