INSERT INTO `TransactionItem` VALUES (69,1,'com.sunshinebeauty.core.Treatment','Aroma Stone Therapy','Since the birth of time, many ancient cultures have used the healing power of stones for medicinal and spiritual purposes.  In Bali, it is believed that \'batu\' stones are filled with the vitality and energy of the water that flows over them in an eternal stream.  Harnessing this power, we then bathe the stones in warm water and anoint them with exotic, sensual aromas of the Orient.<br><br>Small stones are placed on key energy points of the body, evoking an aura of warmth, whilst the deep penetrating heat from the stones are used to massage the body using traditional techniques to ease the pain and tension of aching muscles as well as deeply relax and rebalance the mind and body.',48.75,3,NULL),(70,1,'com.sunshinebeauty.core.Treatment','Aroma Stone Therapy','Since the birth of time, many ancient cultures have used the healing power of stones for medicinal and spiritual purposes.  In Bali, it is believed that \'batu\' stones are filled with the vitality and energy of the water that flows over them in an eternal stream.  Harnessing this power, we then bathe the stones in warm water and anoint them with exotic, sensual aromas of the Orient.<br><br>Small stones are placed on key energy points of the body, evoking an aura of warmth, whilst the deep penetrating heat from the stones are used to massage the body using traditional techniques to ease the pain and tension of aching muscles as well as deeply relax and rebalance the mind and body.',48.75,3,NULL),(71,3,'com.sunshinebeauty.core.Product','Rebalancing Massage Oil 100ml','Rebalancing Massage Oil 100ml',25.5,1,NULL),(71,1,'com.sunshinebeauty.core.Treatment','Aroma Stone Therapy','Since the birth of time, many ancient cultures have used the healing power of stones for medicinal and spiritual purposes.  In Bali, it is believed that \'batu\' stones are filled with the vitality and energy of the water that flows over them in an eternal stream.  Harnessing this power, we then bathe the stones in warm water and anoint them with exotic, sensual aromas of the Orient.<br><br>Small stones are placed on key energy points of the body, evoking an aura of warmth, whilst the deep penetrating heat from the stones are used to massage the body using traditional techniques to ease the pain and tension of aching muscles as well as deeply relax and rebalance the mind and body.',48.75,1,NULL);
