INSERT INTO `Treatment` VALUES (1,'Aroma Stone Therapy','Since the birth of time, many ancient cultures have used the healing power of stones for medicinal and spiritual purposes.  In Bali, it is believed that \'batu\' stones are filled with the vitality and energy of the water that flows over them in an eternal stream.  Harnessing this power, we then bathe the stones in warm water and anoint them with exotic, sensual aromas of the Orient.<br><br>Small stones are placed on key energy points of the body, evoking an aura of warmth, whilst the deep penetrating heat from the stones are used to massage the body using traditional techniques to ease the pain and tension of aching muscles as well as deeply relax and rebalance the mind and body.','',65.00,0.00,65.00,3,75,40,'',15),(2,'Nurturing Massage for Mother-To-Be','This inspirational therapy connects mother and baby through the power of touch, working with two heartbeats as one.<br><br>Specialised positioning on the unique Elemis beanbag is used to ensure the ultimate in safety, comfort and relaxation, helping to relieve tension in the back and alleviating swelling in the hands and feet, while easing the mind and uplifting the spirit.','',65.00,0.00,65.00,3,75,41,'',15),(3,'Fennel Cleansing Cellulite and Colon Therapy','Cellulite is associated with poor circulation, fluid retention and a congested digestive system.  This treatment works at the deepest level to flush and cleanse all three systems.<br><br> A detoxifying Fennel and Birch peel off body mask is combined with specialist drainage massage techniques on the hips and thighs to help smooth the appearance of cellulite, boost blood circulation and reduce fluid retention, leaving your skin firmer an smoother to touch.<br><br>In addition, cleansing of the colon through abdominal massage and reflexology continues the purification of the body','',50.00,0.00,50.00,3,60,42,'',15),(4,'Hawaiian Wave Four Hands','From Hawaii, traditional Lomi Lomi massage movements sweep the length of the body like a synchronised dance. The experience of having two intuitive therapists working at the same time is the closest that one could imagine to such a mystical experience of the sublime.<br><br>Four expert hands complement and follow each other to caress and comfort your bodys energy flow, resulting in the ultimate experience of the power of touch.','',70.00,0.00,70.00,3,75,43,'',-15),(5,'Exotic Lime & Ginger Salt Glow','An exotic exfoliation ritual to invigorate and reviatlise the body.  After light body brushing, warm oil is drizzled luxuriously all over your body before the sublime Elemis Exotic Lime & Ginger Salt Glow is applied.<br><br>Your skin is deeply cleansed, polished and softened to perfection, completed with an application of Exotic Island Flower Body lotion leaving the skin glowing and vibrant, replenished and flawless.','',40.00,0.00,40.00,2,45,20,'',16),(6,'Exotic Frangipani Body Nourish Wrap','This nourishing body wrap drenches the skin with moisture for immediate softness and suppleness.<br><br>Exotic, aromatic Tahitian Coconut and Frangipani flowers are soaked together to produce the Monoi used in this therapy, which Polynesian women traditionally used to protect their skin and provides the ultimate radiance, vitality and all over body glow.','',50.00,0.00,50.00,2,60,19,'',16),(7,'Exotic Coconut Rub & Milk Wrap','A traditional Balinese recipe of Coconut, Mungbean, Spices and Lavender is combined with Exotic Frangipani Monoi Moisture Melt to polish the skin and stimulate the senses. Warmed Skin Nourishing Milk Bath is then poured over your entire body before being cocooned in either a comforting foil wrap.<br><br>Combined with a facial pressure point massage and de-stress scalp treatment.','',50.00,0.00,50.00,2,60,18,'',16),(8,'Exotic Hand Ritual or Sole Delight Foot Treatment','Pure pampering a simply beautiful treatment where the cuticles and nails are massaged with warmed Frangipani Monoi Oil helping nourish, whilst the sensation of the Elemis Skin Nourishing Milk Bath lavishes it riches for smooth, soft hands or feet.  Relaxing head & shoulder or foot & leg massage, finished off with a file & polish of your choice.','',45.00,0.00,45.00,2,60,91,'',-16),(9,'Elemis Strawberry Herbal Back Cleanse','An area we dont often think about.  This treatment acts as a facial for the back, helping to cleanse and replenish leaving the skin radiant and glowing.  Includes Well-Being Back Massage.','',40.00,0.00,40.00,2,45,21,'',-16),(10,'Deep Tissue Muscle Massage','Experience the invigorating, intense Deep Tissue Muscle Massage to relieve specific stress and muscle tension ideal for sports active people.','',25.00,25.00,25.00,1,30,25,'',7),(11,'Well-Being Massage','From the soles of your feet to the crown of your head, this is much more than just a massage.  The power of this ancient touch creates sensations of pleasure and wellness to deeply heal your mind and body, whilst soothing your soul. Your body is lightly brushed, before the gorgeously warmed pure massage oils are smoothed over the face and body. Prescribed to your needs.<br><br><b>Stress-a-Way:</b>  Soothe and relax with Lavender, Chamomile, Melissa, Geranium and Bergamot<br><br><b>Spirit Reviver:</b>  Uplift, detoxify and renew zest for life with Lemon, Lime, Peppermint and Grapefruit <br><br><b>Muscle Melt:</b>  Ease away aching muscles with warming Rosemary, Juniper, Thyme, Birch and Chamomile<br><br><b>Chakra Balancing:</b>  Bring your body and emotions into total equilibrium with Ylang Ylang and Geranium','',45.00,0.00,45.00,1,60,22,'',7),(12,'Well-Being Back or Part Body Massage','Focusing purely on the problem area to relieve tension and aching muscles, the fundamental elements of the well-being massage are experienced in the mini-massage.','',20.00,0.00,20.00,1,30,23,'',7),(13,'MuscleEase Aroma Spa Ocean Wrap','The power of Aromatherapy is combined with the riches of the ocean in this deeply muscle warming treatment.<br><br>A heated seaweed mask containing a warming blend of Pine and Rosemary Essential Oils is applied to your body before you are cocooned in a comforting foil wrap.  Let your thoughts drift away, whilst you have a soothing face and scalp massage and let the active ingredients work to ease arthritis, fatigue and muscle spasm.','',65.00,0.00,65.00,15,75,17,'',17),(14,'Cellutox Aroma Spa Ocean Wrap','Combining the richness of sea plants and marine algae with Aromatherapy, this treatment is deeply detoxifying at all levels.<br><br>A warm seaweed body mask containing a synergy of cleansing Juniper and Lemon Essential Oils is applied to your body before you are cocooned in a foil wrap.  Let your thoughts drift away, whilst you have a soothing face and scalp massage letting the active ingredients work to detoxify, decongest and stimulate your body systems.','',65.00,0.00,65.00,15,75,17,'',17),(15,'Absolute Spa Ritual','From the soles of your feet to the crown of the head this customized face and body treatment is the ultimate skin-therapy.  Choose from one of the unique Advanced Anti-Ageing or Performance Facials and combine it with the powerful effects of Well-Being Massage.','',85.00,0.00,85.00,16,135,75,'',18),(16,'Ocean Riches Wrap','Capture the detoxifying riches of the ocean as you relax cocooned in the warm Cellutox Aroma Spa Wrap followed with refreshing citrus Well-Being Massage and Advanced Anti-ageing or Performance Facial for a complete face and body recharge!','',150.00,150.00,150.00,16,180,92,'',-18),(17,'Exotic Voyage of Touch','Exotic Lime and Ginger Salt Glow Wrap is followed by the ultimate warming Aroma Stone Therapy.','',100.00,100.00,100.00,16,120,93,'',-18),(18,'Tri-Enzyme Resurfacing Facial by Elemis','This ground breaking Anti-Ageing facial instantly resurfaces and smoothes the skin.<br><br>Clinically proven to visibly resurface by up to 75% and increase skin smoothness by up to 32% after just 1 treatment*, this unique treatment targets blemishes, uneven skin tone, superficial facial scarring and fine lines, revealing a younger looking skin.<br><br>\nPioneering the precision layering of 3 targeted enzyme serums, this advanced resurfacing technique safely and effectively removes the thickening layer of the epidermis. Skin is left incredibly clean, smooth and radiant, bringing a renewed level of evenness and clarity to the complexion.','',60.00,60.00,60.00,4,60,90,'',8),(19,'Visible Brilliance Facial for Ageing, Stressed or Slackened Skin','Independently tested with revolutionary results, this Anti-Ageing face and eye treatment instantly firms, rejuvenates & plumps up the skin whilst reducing dark circles from around the eye contour.<br><br>Moisturisation levels of the skin are proven to increase by up to 38% and elasticity by 28% after just 1 treatment.  Specialised micro-circulatory massage techniques are combined with the powerful proven formulations of Liquid Radiance, Cellular Recovery and the two-phase Amino Active Mask to help smooth, sculpt and restore skin radiance and plumpness.<br><br>This superior treatment is further enhanced by a luxurious hand & arm massage and de-stress scalp treatment for the ultimate in scientific skin therapy.','',55.00,0.00,55.00,17,75,9,'',19),(20,'Pro-Collagen Marine Facial for Fine Lines and Wrinkles','Providing immediate results in the fight against time, this exceptional face & eye treatment helps slow down the signs of premature ageing, reducing the appearance of fine lines and wrinkles on the face, eyes and neck.  Specialised lifting massage techniques are combined with the unique Anti-Ageing Japanese Silk mask impregnated with Pro-Collagen booster serum.  The skin will have a more youthful appearance after just 1 treatment.  This superior treatment is further enhanced by a luxurious hand & arm massage and de-stress scalp treatment for the ultimate in scientific skin-therapy.','',55.00,0.00,55.00,17,75,9,'',-19),(21,'Oxygen SkinCalm Facial for Sensitive Skin','This face and eye treatment is a pure and soothing heaven for sensitive skins.  Gentle massage techniques combined with calming actives and a restructuring Japanese Silk Mask help rebalance delicate, fragile and sensitive skins.  Reduces redness offers immediate comfort to stressed skin.  This superior treatment if further enhanced by a luxurious hand & arm massage and de-stress scalp treatment for the ultimate in advanced skin-therapy.','',50.00,0.00,50.00,18,75,6,'',20),(22,'S.O.S Puryfying Facial for Oily, Problem and Congested Skin','This powerful purifying face and eye treatment helps absorb excess sebum, regulate and balance the function of the skin, whilst helping to repair scarring.  Purifying massage techniques combined with the unique Japanese Sulphur Mask impregnated with Vita-C Booster Serum help to calm irritated skin and rebalance oil-rich pores, leaving a beautiful matt skin.  This superior treatment is further enhanced by a luxurious hand & arm massage and de-stress scalp treatment for the ultimate in advanced skin-therapy.','',50.00,0.00,50.00,18,75,6,'',-20),(23,'Fruit Active Glow for Dull, Lifeless Skin','For a powerful skin recharge, this facial will bring back the glow to tired, dull and lifeless complexions.  Skin is deeply cleansed and stimulated by specialist Eastern massage techniques, whilst powerful skin conditioning actives nourish and renew vital radiance.','',40.00,0.00,40.00,19,60,7,'',21),(24,'Exotic Moisture Dew for Dry Skin','For skin in need of a super saturating moister boost, this thirst-quenching facial is perfect.  Following a deep cleanse and nourishing facial massage, the skin is fed with moisture loving actives that will bring back that healthy, dewy look to the skin. ','',40.00,0.00,40.00,19,60,7,'',21),(25,'Herbal Lavender Repair for Combination and Oily Skin','For perfect restoration of skin balance, this facial helps to heal and repair oily, problem and congested skin.  Deeply cleansing to draw out impurities, this facial will help reduce unwanted shine, refine the pores and treat skin breakouts.','',40.00,0.00,40.00,19,60,7,'',21),(26,'Taster Facial by Elemis for All Skin Types','Ideal for those on the run or add this to any Body or Massage Therapy for a little extra treat.  Appropriately named this mini-facial includes all the basics topped off with the ultimate hand and arm massage.','',22.00,0.00,22.00,19,30,8,'',21),(27,'Classic','The improved facial toning routine with additional movements to enhance your treatment.','',40.00,0.00,40.00,20,60,5,'',22),(28,'Advanced','Focusing purely on the problem area to relieve tension and aching muscles, the fundamental elements of the well-being massage are experienced in the mini-massage.','',50.00,50.00,50.00,20,75,10,'',-22),(29,'Eye Zone','Concentrating on the eye area to reduce fine lines, dark circles and puffiness.','',30.00,0.00,30.00,20,30,81,'',-22),(30,'Lunchtime Lift','An intensive facial toning programme designed for maximum results in minimal time.','',35.00,0.00,35.00,20,45,35,'',-22),(31,'Tri-Enzyme Resurfacing Facial by Elemis','This ground breaking Anti-Ageing facial instantly resurfaces and smoothes the skin.<br><br>Clinically proven to visibly resurface by up to 75% and increase skin smoothness by up to 32% after just 1 treatment*, this unique treatment targets blemishes, uneven skin tone, superficial facial scarring and fine lines, revealing a younger looking skin.<br><br>\n','',60.00,60.00,60.00,5,60,103,'',9),(32,'Skin I.Q.','Is designed to recharge and energise tired skin, whilst relieving tension in the shoulder and neck area.  This professional treatment uses advanced scientific formulations, specifically targeted to men?s skin.','',55.00,0.00,55.00,28,75,82,'',23),(33,'Urban Cleanse','The powerful therapeutic-grade ingredients deep cleanse and decongest to rapidly accelerate skin repair and hydration, calming irritation and reducing sensitivity to leave the skin visibly clear, youthful and improved.','',40.00,0.00,40.00,28,60,83,'',23),(34,'Total Time Out','Combine your choice of men\'s facial with the dynamic effects of the <b>Elemis Deep Tissue Muscle Massage</b> for immediate tension-relief of the back, neck and shoulders.','',65.00,65.00,65.00,28,105,69,'',23),(35,'Express Pedicure','A quick foot soak to soften the nails ready to be cut and filed finished off with a polish of your choice.','',15.00,0.00,15.00,6,30,84,'',24),(36,'Complete Pedicure','The hard skin on your feet is filed away then placed in the foot spa to soften the skin ready for exfoliation.  Toenails are cut and filed to shape, cuticles treated and nourished.  We then apply moisturiser to nourish your feet and foot spray leaving your feet feeling refreshed.  Then finally finish off with a polish of your choice.','',25.00,0.00,25.00,6,60,30,'',24),(37,'Deluxe Pedicure','The hard skin on your feet is filed away then placed in the foot spa to soften the skin. We then apply a deluxe salt scrub for toe to knee exfoliation preparing the skin for a relaxing foot and leg massage.  The feet are cocooned then placed into heated booties for deeper moisturisation.  Toenails are cut and filed into shape, cuticles treated and nourished. This is then followed by a revitalising foot mask and spray.  Then finally finished off with a polish of your choice, leaving you walking on air.','',30.00,0.00,30.00,6,75,31,'',24),(38,'Repolish','Simply Polished to Perfection!','',6.50,0.00,6.50,6,15,74,'',24),(39,'Express Manicure','A quick moisturise and soak to soften the nails ready to be cut and filed into shape finished off with a polish of your choice.','',15.00,0.00,15.00,7,30,26,'',25),(40,'Complete Manicure','Hands, nails and cuticles are nourished followed with a relaxing hand massage, a brief soak will help soften the nails and cuticles for trim and file into shape.  Finished with the polish of your choice.','',22.50,0.00,22.50,7,60,27,'',25),(41,'Deluxe Manicure','Le Remedie Anti-Ageing treatment includes a hand cleanse, exfoliation and mask followed by a luxurious hand and arm massage.  Anti-ageing Serum is applied the hands are cocooned then placed into heated mittens for deeper moisturisation.  Followed by a brief soak to help soften the nails and cuticles for trim and file into shape. Leaving your skin looking noticeably brighter and hydrated finished with the polish of your choice for the perfect 10.','',28.50,28.50,28.50,7,75,28,'',25),(42,'Repolish','Simply Polished to Perfection!','',6.50,0.00,6.50,7,15,29,'',25),(43,'Nail Art Extras','Various Designs available from hand painted to bling bling on the above treatments.','',10.00,0.00,10.00,27,15,33,'',10),(44,'Natural Nail Overlays','Permanent Polish for fingers or toes, CalGel a chip resistant finish lasting up to 4 weeks in the colour of your choice. ','',30.00,0.00,35.00,22,75,66,'',26),(45,'Tips','Tips are applied to the nail with no free edge when length is required, blended and shaped in CalGel a chip resistant finish lasting up to 4 weeks in the colour of your choice.','',35.00,0.00,49.00,22,120,64,'',26),(46,'Sculpting','Using a form placed under the free edge length is added by free hand sculpting, blended and shaped in CalGel a chip resistant finish lasting up to 4 weeks in the colour of your choice. ','',45.00,0.00,55.00,22,135,65,'',26),(47,'Infills','Maintenance required every 3-4 weeks, as the nails grow CalGel Infill is required.  The base of the nail is prepared and filled to continue with a chip resistant colour lasting up to 4 weeks in the colour of your choice.  This procedure is recommended no more than 3 times then safe removal is needed and CalGel reapplied.','',20.00,0.00,27.50,22,60,67,'',26),(48,'Safe Removal','The CalGel on the nail is gently buffed to remove the shine and Calaway soaked cotton wool is applied and foil wrapped onto each nail.  After some time each foil is removed and the CalGel has softened to enable gentle safe removal.  The nails are lightly buffed and clean ready for your next set of Natural Nail Enh